import React from "react";


export default function Frag ({img,name,phone,email}){
   
    return(
        <div className="test">
            <img src={img} width="150px"/>
            <h3>{name}</h3>
            <div>
                <p> {phone} </p>

            </div>
            <div>
                <p>{email} </p>
            </div>

        </div>
    )
}

const person={
    img:"./img/swim.png",
    name:"cat3",
    phone:"061500555",
    email:"cat3@gmmail.com"
}

const{img,name}=person;
console.log(name)
